import React from 'react';

function TranscriptionDisplay({ transcription, allTranscriptions }) {
  return (
    <div className="transcription-display">
      <h2>Live Text:</h2>
      <p className="live-text">{transcription || '...'}</p>
      <h2>History:</h2>
      <div className="history-log">
        {allTranscriptions.map((text, index) => (
          <p key={index}>{text}</p>
        ))}
      </div>
    </div>
  );
}

export default TranscriptionDisplay;
